def nearestExit(maze, entrance) -> int:
    import collections
    q = collections.deque()
    entrance.append(0)
    q.append(entrance)
    while q:
        x, y, level = q.popleft()
        maze[x][y] = "+"
        if (x == 0 or y == 0 or x == len(maze) - 1 or y == len(maze[x]) - 1) and level != 0:
            return level
        for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            nx, ny = x + dx, y + dy
            if 0 <= nx < len(maze) and 0 <= ny < len(maze[0]) and maze[nx][ny] != "+":
                maze[nx][ny] = "+"
                q.append([nx, ny, level + 1])
    return -1

